import Vue from 'vue'
import Router from 'vue-router'

Vue.use(Router)


const router = new Router({
    routes: [
        {
            path: '/',
            name: 'HomePage',
            component: () => import('@/pages/homePage')
        },
        {
            path: 'Main',
            name: 'mainInfoPage',
            component: () => import('@/pages/mainInfoPage')
        }
    ]
})

export default router
